function getRandomInt(min,max){return Math.floor(Math.random()*(max-min+1))+min}function rand(min,max){return Math.random()*(max-min)+min}function getWeightedRandom(list,weight){let total_weight,random_num=rand(0,weight.reduce((function(prev,cur){return prev+cur}))),weight_sum=0;for(let i=0;i<list.length;i++)if(weight_sum+=weight[i],weight_sum=+weight_sum.toFixed(2),random_num<=weight_sum)return list[i]}function shuffle(max,len){let a=[];for(;a.length<len;){let randomnumber=Math.floor(Math.random()*max)+1;a.indexOf(randomnumber)>-1||(a[a.length]=randomnumber)}return a}